import "./App.css";
import Posts from "./components/posts";
import Form from "./components/postForm";
import Register from "./components/registerForm";
// Redux
import store from "./store";
import { Provider } from "react-redux";

function App() {
  return (
    <Provider store={store}>
      <registerForm />
      <Posts />
      <Form />
    </Provider>
  );
}

export default App;
